## Input File

File name: "InventoryNotificationMDB.java"
Source file contents:
```java
package com.redhat.coolstore.service;

import com.redhat.coolstore.model.Order;
import com.redhat.coolstore.utils.Transformers;
import io.quarkus.smallrye.jms.annotation.MessageListener;
import io.quarkus.smallrye.jms.annotation.JmsDestination;
import javax.jms.Connection;
import javax.jms.ConnectionFactory;
import javax.jms.JMSException;
import javax.jms.Message;
import javax.jms.Session;
import javax.jms.TextMessage;
import javax.enterprise.context.ApplicationScoped;
import javax.enterprise.inject.Produces;
import javax.inject.Inject;
import javax.jms.Topic;
import javax.jms.TopicSubscriber;
import javax.naming.Context;
import javax.naming.InitialContext;
import javax.naming.NamingException;
import java.util.Hashtable;

@ApplicationScoped
public class InventoryNotificationMDB {

    private static final int LOW_THRESHOLD = 50;

    @Inject
    private CatalogService catalogService;

    private final static String JNDI_FACTORY = "weblogic.jndi.WLInitialContextFactory";
    private final static String JMS_FACTORY = "TCF";
    private final static String TOPIC = "topic/orders";

    @JmsDestination("topic/orders")
    public void onMessage(Message rcvMessage) {
        TextMessage msg;
        {
            try {
                System.out.println("received message inventory");
                if (rcvMessage instanceof TextMessage) {
                    msg = (TextMessage) rcvMessage;
                    String orderStr = msg.getBody(String.class);
                    Order order = Transformers.jsonToOrder(orderStr);
                    order.getItemList().forEach(orderItem -> {
                        int old_quantity = catalogService.getCatalogItemById(orderItem.getProductId()).getInventory().getQuantity();
                        int new_quantity = old_quantity - orderItem.getQuantity();
                        if (new_quantity < LOW_THRESHOLD) {
                            System.out.println("Inventory for item " + orderItem.getProductId() + " is below threshold (" + LOW_THRESHOLD + "), contact supplier!");
                        } else {
                            orderItem.setQuantity(new_quantity);
                        }
                    });
                }
            } catch (JMSException jmse) {
                System.err.println("An exception occurred: " + jmse.getMessage());
            }
        }
    }

    @Produces
    @ApplicationScoped
    public ConnectionFactory connectionFactory() {
        try {
            Hashtable<String, String> env = new Hashtable<>();
            env.put(Context.INITIAL_CONTEXT_FACTORY, JNDI_FACTORY);
            env.put(Context.PROVIDER_URL, "t3://localhost:7001");
            env.put("weblogic.jndi.createIntermediateContexts", "true");
            InitialContext ctx = new InitialContext(env);
            return (ConnectionFactory) ctx.lookup(JMS_FACTORY);
        } catch (NamingException e) {
            throw new RuntimeException(e);
        }
    }

    @Produces
    @ApplicationScoped
    public Topic topic() {
        try {
            Hashtable<String, String> env = new Hashtable<>();
            env.put(Context.INITIAL_CONTEXT_FACTORY, JNDI_FACTORY);
            env.put(Context.PROVIDER_URL, "t3://localhost:7001");
            env.put("weblogic.jndi.createIntermediateContexts", "true");
            InitialContext ctx = new InitialContext(env);
            return (Topic) ctx.lookup(TOPIC);
        } catch (NamingException e) {
            throw new RuntimeException(e);
        }
    }

    @Produces
    @ApplicationScoped
    public TopicSubscriber subscriber() {
        try {
            Connection connection = connectionFactory().createConnection();
            Session session = connection.createSession(false, Session.AUTO_ACKNOWLEDGE);
            Topic topic = topic();
            return session.createSubscriber(topic);
        } catch (JMSException e) {
            throw new RuntimeException(e);
        }
    }

    public void close() {
        try {
            subscriber().close();
        } catch (JMSException e) {
            System.err.println("An exception occurred: " + e.getMessage());
        }
    }
}
```

